import {
  Paper,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
} from "@material-ui/core";
import react from "react";
import { useDispatch, useSelector } from "react-redux";
import { tableDataLoadStart } from "./action";
import homePageStyles from "./styles";
const HomePage = () => {
  const classes = homePageStyles();
  const dispatch = useDispatch();
  react.useEffect(() => {
    dispatch(tableDataLoadStart());
  }, []);
  const storeState = useSelector((state) => {
    return state.tableDataReducer;
  });
  const { data } = storeState.data;
  return data ? (
    <Paper className={classes.root}>
      <Table stickyHeader>
        <TableHead>
          <TableRow>
            {Object.keys(data[0])
              .slice(1)
              .map((key) => {
                return (
                  <TableCell>
                    {key.splice(0, key.indexOf("N")) +
                      " " +
                      key
                        .toUpperCase()
                        .splice(key.indexOf("N"), key.length() - 1)}
                  </TableCell>
                );
              })}
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map((key) => {
            return (
              <TableRow key={key.id}>
                {Object.values(key)
                  .slice(1)
                  .map((value) => {
                    return (
                      <TableCell>
                        <a href={value.includes("https") ? value : null}>
                          {value}
                        </a>
                      </TableCell>
                    );
                  })}
              </TableRow>
            );
          })}
        </TableBody>
      </Table>
    </Paper>
  ) : (
    <h1>Nothing</h1>
  );
};
export default HomePage;
